import React from 'react';

function ImagenCargadaCaptura({ imagen }) {
  return (
    <div className='imgencontrada'>
      Resultado
      <div className='muestraimagen'>
        {/* Mostrar la imagen utilizando la prop imagen */}
        <img src={imagen} alt="Vestido " style={{ width: '200px', height: '300px' }} className='img' />
      </div>
    </div>
  );
}

export default ImagenCargadaCaptura;
